y = []
X1 = []
X2 = []
X3 = []
X4 = []
X5 = []
X6 = []


for i in range(0, len(dados_R454C('t_sat'))):

    vs = dados_R454C('vs')[i]
    vv = dados_R454C('vv')[i]
    delta_ts = dados_R454C('delta_ts')[i]
    t_sat = dados_R454C('t_sat')[i]

    # Igualdade
    y.append((vs / vv) - 1)

    # Primeiro termo
    X1.append(delta_ts)

    # Segundo termo
    X2.append(delta_ts ** 2)

    # Terceiro termo
    X3.append(delta_ts * t_sat)

    # Quarto termo
    X4.append(t_sat * delta_ts ** 2)

    # Quinto termo
    X5.append(delta_ts * t_sat ** 2)

    # Sexto termo
    X6.append((delta_ts ** 2) * (t_sat ** 2))



def calculo_entalpia_superaquecido(params):
    b1, b2, b3, b4, b5, b6 = params
    y_pred = b1 * np.array(X1) + b2 * np.array(X2) + b3 * np.array(X3) + b4 * np.array(X4) + b5 * np.array(X5) + b6 * np.array(X6)
    return np.max((y_pred - y) ** 2)


