a25C = 5.94101838e-03
a26C = -4.07042018e-06
a27C = 3.16817221e-05
a28C = -1.88840783e-07
a29C = 6.41317333e-07
a30C = -2.14105855e-09


dados_esperados_R454C = []
dados_encontrados_R454C = []

for i in range(0, len(dados_R454C('t_sat'))):

    vs = dados_R454C('vs')[i]
    vv = dados_R454C('vv')[i]
    delta_ts = dados_R454C('delta_ts')[i]
    t_sat = dados_R454C('t_sat')[i]

    X1 = delta_ts
    X2 = delta_ts**2
    X3 = delta_ts*t_sat
    X4 = (delta_ts**2)*t_sat
    X5 = delta_ts*(t_sat**2)
    X6 = (delta_ts**2)*(t_sat**2)

    polinomio  = a25C * X1 + a26C * X2 + a27C * X3 + a28C * X4 + a29C * X5 + a30C * X6

    dadosEncontrados = vv*(1 + polinomio)


    dados_encontrados_R454C.append(dadosEncontrados)
    dados_esperados_R454C.append(dados_R454C('vs')[i])


